import React from 'react'


function VIEWUSER() {
    return (
        <div>
            <h1>
            <a href="/admin">go to admin page</a>
            </h1>
            <div className="container mt-5">
                 <div className="row">

                     <ul>
                     {
                         user.map(item=>(
                            <li>
                             {item.username}
                             {
                                 item.email
                             }
                            </li>   
                         ))
                     }
                     </ul>

                 </div>

            </div>
        </div>
    )
}

export default VIEWUSER
